const Weather = (props) => {
    const { kecamatan, kota, provinsi, id } = props;
    return (
        <div className="weather">
            <NavLink to={`/detail/${id}`}>{provinsi}
                {/* <p className="kota">{kota}</p> */}
                {/* <p className="kecamatan">{kecamatan}</p> */}
            </NavLink>
        </div>
    );
};

export default Weather;
